			INNER JOIN pm_inventory on pm_inventory.idinventory = price_list.mm_prices_inventory_idinventory
			where mm_suppliers_idsuppliers = supid);

	CREATE TEMPORARY TABLE IF NOT EXISTS sup_price2 AS 
