	INNER JOIN inventory on inventory.idinventory = salesorderitems.inventory_idinventory
    where salesorderitems.salesorder_idsalesorder = sid AND salesorderitems.itemstatus = stat
    GROUP BY idsalesorderitem;
END ;;
